import './nav.css';

function Nav() {
  return (
  	<nav>

  	<ul className="menu">

    <li className="item"><a href="#">Home</a></li>
    <li className="item"><a href="#">Equipo</a></li>
    <li className="item"><a href="#">Servicios</a></li>
    <li className="item"><a href="#">Agenda tu cita</a></li>
    <li className="item"><a href="#">Contactenos</a></li>
    
    </ul>
  
  	</nav>
  );
} 

export default Nav;
